import React from "react";

function Map() {
  return (
    <div>
      <div className="">
        <iframe
          src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3683.355244743678!2d88.42174527591851!3d22.60320573184673!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3a0275c451dd324d%3A0x9b29b4718b87c269!2sAARHAT%20iSERV%20LLP%20%7C%20Best%20Digital%20Marketing%20%2F%20Website%20Designing%20%2F%20Graphic%20Designing%20%2F%20SEO%20%2FAdvertisemnet%20Agency%20in%20Kolkata!5e0!3m2!1sen!2sin!4v1686901090725!5m2!1sen!2sin"
          allowfullscreen=""
          loading="lazy"
          referrerpolicy="no-referrer-when-downgrade"
          className="pb-16 w-full h-96"
          style={{ border: "0" }}
        ></iframe>
      </div>
    </div>
  );
}

export default Map;
